import React, { Component } from 'react'
import GoLogin from '../../../utils/isLogin'

class Order extends Component {
    state={
        list:[],
        navTitle:[
            {
                path:"/index/order/diancan",
                text:"点餐"
            },
            {
                path:"/index/order/comment",
                text:"评论"
            },
            {
                path:"/index/order/business",
                text:"商家"
            }
        ],
        ind:0
    }
    changeLy = (url,ind)=>{
        this.setState({ind})
        this.$router.push(url)
    }
    render() {
        return (
            <div>
                <div className="nav">
                    {
                        this.state.list && this.state.list.map((item,index)=>{
                        return (<p key={index} className={index==this.state.ind?'active':""} onClick={this.changeLy.bind(this,item.path,index)}>{item.text}</p>)
                        })
                    }
                </div>
            </div>
        )
    }
}


export default GoLogin(Order)
